// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Burnable.sol";

contract Myercnew is ERC1155, Ownable, ERC1155Burnable {
    constructor(address initialOwner)
        ERC1155("https://gateway.pinata.cloud/ipfs/QmZeZoZHhAN1jWAdC3xKEUMNQ76fUfH1QTrgchttps://gateway.pinata.cloud/ipfs/QmZeZoZHhAN1jWAdC3xKEUMNQ76fUfH1QTrgcDewWhirP2/DewWhirP2")
        Ownable(initialOwner)
    {}

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function mint(address account, uint256 id, uint256 amount, bytes memory data)
        public
        onlyOwner
    {
        _mint(account, id, amount, data);
    }

    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        public
        onlyOwner
    {
        _mintBatch(to, ids, amounts, data);
    }
}

